import React, { useEffect, useState } from "react";
import Table from "../Table/Table";

const CPCalendar = () => {
  const [data, setData] = useState([]);
  const fetchContest = async () => {
    try {
      const res = await fetch(
        `https://clist.by/api/v2/contest/?username=himanshu_patel&api_key=${REACT_APP_CLIST_KEY}&upcoming=true&ongoing=true&format_time=true&order_by=resource_id&limit=50`
      );
      const result = await res.json();
      console.log(res);
      setData(result.objects);
    } catch (error) {
      console.log({ message: error.message });
    }
  };
  useEffect(() => {
    fetchContest();
  }, []);
  console.log("Data", data);
  return (
    <div>
      <div className="datatable-container">
        <table className="datatable">
          <thead>
            <tr>
              <th>Event</th>
              <th>Start</th>
              <th>End</th>
              <th>Duration</th>
              <th>id</th>
              <th>Link</th>
            </tr>
          </thead>
        </table>
      </div>
      {data?.map((contest, i) => (
        <div>
          {console.log(contest)}
          <Table
            key={i}
            Event={contest.event}
            Start={contest.start}
            End={contest.end}
            Duration={contest.duration}
            Id={contest.id}
            Link={contest.href}
          />
        </div>
      ))}
    </div>
  );
};

export default CPCalendar;
